function selectOrder(e){$("#inputSelectedOrderId").val(e),$("#btOpenOrder").click()}function saveOrder(){if(null!=$("#contactName").val()&&""!==$("#contactName").val()&&null!=$("#contactPhone").val()&&""!==$("#contactPhone").val()&&null!=$("#category").val()&&""!==$("#category").val()&&null!=$("#deadline").val()&&""!==$("#deadline").val()){var e={contactName:$("#contactName").val(),contactPhone:$("#contactPhone").val(),realEstateAgency:$("#realEstateAgency").val(),description:$("#orderDescription").val(),company:$("#company").val(),categoryId:$("#category").val(),deadline:$("#deadline").val()};$.ajax({type:"POST",contentType:"application/json; charset=utf-8",data:JSON.stringify(e),url:"/orders",success:function(e){Swal.fire({icon:"success",title:"Ok",text:"Order save successfully!"}).then(e=>{window.open("/","_self")})},error:function(e,t){Swal.fire({icon:"error",title:"Oops...",text:"The order didn't be saved!"})},fail:function(e){Swal.fire({icon:"error",title:"Oops...",text:"The order didn't be saved!"})}})}else Swal.fire({icon:"error",title:"Oops...",text:"Contact Name, Contact Phone, Category and Deadline are required!"})}$("#tbOrders").DataTable({dom:"Brt"});